import React from 'react'
// import './NestedMapping.css'

const UserList = [
        {
          "name":"Bangladesh",
          "population":"18crore",
        },
        {
          "name":"India",
          "population":"100 crore, I don't know actually",
          "country":[
            {
              "education":"good",
              "duck":"122"
            }

          ]
        },
]

function NestedMapping() {
  return (
    <div className='container'>
           
       {UserList.map((user)=>(
        
        <article>
            <p>Name:{user.name}</p>
            <p>population:{user.population}</p>
            {
              user.country.map((contry)=>(<div>
                  <p>{contry.education}</p>
                  <p>{contry.duck}</p>
              </div>
              ))
            }
        </article>
       ))}

    </div>
  )
}

export default NestedMapping
